import React, { useState, useEffect } from "react";
import { PieChart, Pie, Cell, Tooltip, ResponsiveContainer } from "recharts";
import { performAnalysis } from "./AnalysisGet";

const AnalysisDisplay = () => {
  const [analysisResults, setAnalysisResults] = useState(null);
  const [error, setError] = useState(null);
  const [hoverIndex, setHoverIndex] = useState(null); // Track hovered segment index

  useEffect(() => {
    const fetchData = async () => {
      try {
        const results = await performAnalysis();
        setAnalysisResults(results);
      } catch (err) {
        setError(err);
      }
    };

    fetchData();
  }, []);

  if (error) {
    console.error("Error fetching analysis data:", error);
  }

  if (!analysisResults && !error) {
    return <div>Loading...</div>;
  }

  const { averageWin = 0, averageLoss = 0 } = analysisResults || {};
  const total = averageWin + averageLoss;
  const winPercent = total > 0 ? (averageWin / total) * 100 : 50;

  const data = [
    {
      name: "Average Win",
      value: winPercent,
      color: "#4a90e2",
      amount: averageWin,
    },
    {
      name: "Average Loss",
      value: 100 - winPercent,
      color: "#f44336",
      amount: averageLoss,
    },
  ];

  const formatCash = (value) => `$${value.toFixed(2)}`;

  return (
    <div
      className="analysis-display-container"
      style={{ width: "150px", margin: "0 auto", position: "relative" }}
    >
      <ResponsiveContainer width="100%" height={150}>
        <PieChart>
          <Pie
            data={data}
            innerRadius={50}
            outerRadius={70}
            dataKey="value"
            startAngle={90}
            endAngle={-270}
            stroke="none"
          >
            {data.map((entry, index) => (
              <Cell
                key={`cell-${index}`}
                fill={entry.color}
                style={{
                  cursor: "pointer",
                }}
                onMouseEnter={() => setHoverIndex(index)}
                onMouseLeave={() => setHoverIndex(null)}
              />
            ))}
          </Pie>
          <Tooltip
            cursor={false}
            content={({ payload }) => {
              if (payload && payload.length) {
                const { name, amount } = payload[0].payload;
                return (
                  <div className="tooltip-content">
                    <p>{name}</p>
                    <p className="amount">{formatCash(amount)}</p>
                  </div>
                );
              }
              return null;
            }}
          />
        </PieChart>
      </ResponsiveContainer>

      {/* Inner Shadow Circle */}
      {hoverIndex !== null && (
        <div
          className="inner-shadow-circle"
          style={{
            position: "absolute",
            width: "100px", // Set to innerRadius * 2
            height: "100px",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            borderRadius: "50%",
            boxShadow: `0 0 15px ${data[hoverIndex].color}`,
            pointerEvents: "none", // Prevents interference with hover
          }}
        ></div>
      )}
    </div>
  );
};

export default AnalysisDisplay;

